import React, {useState, useEffect} from 'react';
import styled from 'styled-components';


const Styles = styled.div`
   padding : 0 5%;
   box-shadow:0 20px rgba(0,0,0, 0.253);
   `;

function SearchResult(props){
    return(
        <React.Fragment>
            <Styles>
                <h5>Notre selection de pneus : {props.dimensions.largeur}/{props.dimensions.hauteur} R{props.dimensions.diametre} {props.dimensions.charge}</h5>
                <hr/>
                {props.resultat.map( (res) => 
                <div>
                        <p>{res.pneu_id}</p>
                        <p>{res.collection}</p>
                        <p>{res.charge}</p>
                        <p>{res.designation_pneu}</p>
                        <p>{res.marque}</p>
                        <p>{res.image}</p>
                        <img
                            src={`https://www.monsterstudio.org${res.image}`}
                        />
                </div>
                )}            
        </Styles>
        </React.Fragment>
    )
}

export default SearchResult;

/**
